import React from 'react';
import {Launch} from '../Launch';
import Axios from 'axios';
import "./styles.scss";

export class Launches extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            start: props.start,
            end: props.end,
            launches: [],
            callBack: props.callBack
        }
    }
    componentDidMount = () => {
        console.log("mounted");
        const queryString = ("start=" + this.state.start + "&end=" + this.state.end);
        console.log(queryString);
        Axios.get('https://api.spacexdata.com/v3/launches/past?' + queryString)
        .then((response) => {
            console.log(response);
            this.setState({
                launches: response.data
            })
        });
    }
    componentDidUpdate = () => {
        const queryString = ("start=" + this.state.start + "&end=" + this.state.end);
        console.log(this.state.start);
        console.log("updated");
        Axios.get('https://api.spacexdata.com/v3/launches/past?' + queryString)
        .then((response) => {
            console.log(response);
        });
    }
    componentWillUnmount = () => {
        console.log("unmounted");
    }
    render = () => {
        const launchesMap = this.state.launches.map(() => {//map through array of launches and display info
            return <Launch img="" title="" date="" desc="" payload=""/>;
        });
        return (
            <div className="launches">
                {launchesMap}
            </div>
        );
    }
}
